import React from 'react'
import Navbar from '../Components/Navbar'
import Carousel from '../Components/Carousel'

const Home = () => {
    return (
    <>
        <Navbar />
        <Carousel />
        <h1> Home </h1>
    </>
  )
}

export default Home
